Знаю ТОР менеджеров, которые решают задачи в бизнесах от 1 млрд.рублей:
-уже в 2005 году я вошел в ТОП-10 Рейтинга консультантов по подбору персонала Executive Search, составленного журналом Эксперт совместно с Ассоциацией Менеджеров;
-2014-2017 г.г. Президент Ассоциации консультантов по подбору персонала;
-20 лет Executive Search в качестве руководителя и консультанта;
-успешно выполнил более 500 рекрутинговых проектов;
-Председатель кадрового комитета Ассоциации российских банков;
-Сертифицированный консультант-аналитик PDA International.
